import React from 'react';

import '../assets/vendor/bootstrap/css/bootstrap.min.css';
import '../assets/vendor/icofont/icofont.min.css';
import '../assets/vendor/boxicons/css/boxicons.min.css';
import '../assets/vendor/owl.carousel/assets/owl.carousel.min.css';
import '../assets/vendor/venobox/venobox.css';
import '../assets/vendor/aos/aos.css';

export default function Login() {

	return(
		<header id="header" class="fixed-top">
    		<div class="container d-flex">

      <div class="logo mr-auto">
        <h1 class="text-light"><a href="index.html">Meus Sinais</a></h1>
      </div>

      <nav class="nav-menu d-none d-lg-block">
        <ul>
          <li class="active"><a href="#header">Página Inicial</a></li>
          <li><a href="#sobre">Sobre nós</a></li>
          <li><a href="#faq">Dúvidas?</a></li>

			<li><a href="#">Colaborador</a><br/></li>
			<li><a href="#">Paciente</a><br/></li>

          <li class="get-started"><a href="#">Agendar atendimento</a></li>
        </ul>
      </nav>

    </div>
  </header>
		);
}
